import { createSelector } from "@reduxjs/toolkit";

/** Selector **/
const userSelector = (state) => state.User;

const selectUserSelector = createSelector(
    userSelector,
    state => state.users);
const selectPageSelector = createSelector(
    userSelector,
    state => state.page);
    
 const selectSizeSelector = createSelector(
    userSelector,
    state => state.size);
    
